import Link from 'next/link';
const data = [
    {
        id: 10086,
        name: "LOL"
    },
    {
        id: 655,
        name: "Girl"
    }
];

const TestLink = ({data}) => (
    <div>
        <Link href={`/router/test?q=${data.id}`}>Link to { data.name } Page</Link>
    </div>
);

const Index = () => (
    <div>
        { data.map(item => (
            <TestLink data={item} />
        ))}
    </div>
);

export default Index;
